import {
    UilEstate,
    UilClipboardAlt,
    UilUserAlt,
    UilPackage,
    UilChart,
    UilSignOutAlt
} from '@iconscout/react-unicons';

export const SidebarData = [
    {
        icon: UilEstate,
        heading: 'Dashboard'
    },
    {
        icon: UilClipboardAlt,
        heading: 'Orders'
    },
    {
        icon: UilUserAlt,
        heading: 'Customers'
    },
    {
        icon: UilChart,
        heading: 'Analytics'
    }
]
